import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { FormsModule } from '@angular/forms';

import { IonicModule } from '@ionic/angular';

import { NewpermissaoPageRoutingModule } from './newpermissao-routing.module';

import { NewpermissaoPage } from './newpermissao.page';

@NgModule({
  imports: [
    CommonModule,
    FormsModule,
    IonicModule,
    NewpermissaoPageRoutingModule
  ],
  declarations: [NewpermissaoPage]
})
export class NewpermissaoPageModule {}
